def _make_parent_dirs_and_return_path(file_path: str):
    import os
    os.makedirs(os.path.dirname(file_path), exist_ok=True)
    return file_path

def _purge_unused_features(
    unpurged_metadata,
    selected_features,
    output_metadata,
):
  """Purge features from metadata if not included in selected features.

  Args:
    unpurged_metadata: metadata generated by example gen.
    selected_features: selected feature names separated by comma.
    output_metadata: purged metadata.
  """
  # pylint: disable=g-import-not-at-top,import-outside-toplevel
  import json
  # pylint: enable=g-import-not-at-top,import-outside-toplevel
  with open(unpurged_metadata, "r") as f:
    metadata_path = f.read()
    metadata = json.loads(metadata_path)

  with open(selected_features, "r") as f:
    selected_features_path = f.read()
    features = json.loads(selected_features_path)

  train_spec = metadata["train_spec"]

  features_set = set(features)

  purged_transformation_list = []
  for transformation in train_spec["transformations"]:
    if "numeric" in transformation:
      if transformation["numeric"]["column_name"] in features_set:
        purged_transformation_list.append(transformation)
    elif "categorical" in transformation:
      if transformation["categorical"]["column_name"] in features_set:
        purged_transformation_list.append(transformation)
    elif "timestamp" in transformation:
      if transformation["timestamp"]["column_name"] in features_set:
        purged_transformation_list.append(transformation)
    elif "text" in transformation:
      if transformation["text"]["column_name"] in features_set:
        purged_transformation_list.append(transformation)
    elif "repeated_numeric" in transformation:
      if transformation["repeated_numeric"]["column_name"] in features_set:
        purged_transformation_list.append(transformation)
    elif "repeated_categorical" in transformation:
      if transformation["repeated_categorical"]["column_name"] in features_set:
        purged_transformation_list.append(transformation)
    elif "repeated_text" in transformation:
      if transformation["repeated_text"]["column_name"] in features_set:
        purged_transformation_list.append(transformation)
    else:
      raise ValueError(f"unsupported transformation: {transformation}")

  train_spec["transformations"] = purged_transformation_list
  metadata["train_spec"] = train_spec

  with open(output_metadata, "w") as f:
    f.write(json.dumps(metadata))

import argparse
_parser = argparse.ArgumentParser(prog='Purge unused features', description='Purge features from metadata if not included in selected features.')
_parser.add_argument("--unpurged-metadata", dest="unpurged_metadata", type=str, required=True, default=argparse.SUPPRESS)
_parser.add_argument("--selected-features", dest="selected_features", type=str, required=True, default=argparse.SUPPRESS)
_parser.add_argument("--output-metadata", dest="output_metadata", type=_make_parent_dirs_and_return_path, required=True, default=argparse.SUPPRESS)
_parsed_args = vars(_parser.parse_args())

_outputs = _purge_unused_features(**_parsed_args)
